   var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"f0d5598b-65d0-4369-82cd-fb2553d8d770","type":"CustomJS"},{"attributes":{},"id":"97eb8e67-ad0a-4114-9fbb-e00096da9d86","type":"BasicTickFormatter"},{"attributes":{"children":[{"id":"1995b349-bfd7-4428-b196-5b7e6e2eb275","type":"WidgetBox"},{"id":"667af1da-4e35-48f5-8482-a1f565619b7a","subtype":"Figure","type":"Plot"}]},"id":"952e2ec9-1701-4ca7-876a-2fd71dadea50","type":"Column"},{"attributes":{},"id":"b66727ef-0600-477b-8e77-0619d954ca64","type":"ResetTool"},{"attributes":{},"id":"2b00087a-a29b-46f8-ba8e-b12f9b328660","type":"BasicTickFormatter"},{"attributes":{"formatter":{"id":"2b00087a-a29b-46f8-ba8e-b12f9b328660","type":"BasicTickFormatter"},"plot":{"id":"667af1da-4e35-48f5-8482-a1f565619b7a","subtype":"Fig
